export default (state = {}, action) => {
	console.log("HEY THERE: ", action)
  switch (action.type) {
    case "PULL_TRIGGER":
      let x = {
        ...state,
        [action.payload]: true
      };
      console.log("X IS:", x);
      return x
    case "RESET_TRIGGER":
    	let y = {
    		...state,
    		[action.payload]: false
    	};
    	console.log("Y IS:", y);
    	return y;
    default:
      return state
  }
}
